import React from "react";
import { useLocation } from "react-router-dom";

export default function ViewEmployee() {
  const location = useLocation();
  console.log("Location:", location); // Log the entire location object
  const { empDetails } = location.state || {};
  console.log("EmpDetails:", empDetails); // Log the empDetails object
  return (
    <div>
      <h1>View Employee</h1>
      <p>Employee ID: {empDetails?.empid}</p>
      <p>Name: {empDetails?.ename}</p>
      <p>Designation: {empDetails?.designation}</p>
      <p>Joining Date: {empDetails?.jdate}</p>
      <p>Status: {empDetails?.status}</p>
    </div>
  );
}
